webpackJsonp([0xc2f56927166c],{962:function(n,s){n.exports={data:{site:{siteMetadata:{siteTitle:"gatsby-starter-skinny-docs",siteTitleAlt:"A Skinny Gatsby Starter Template for Creating Docs",siteDescription:"Get your docs site up and going with Gatsby.",siteFullUrl:null,siteLogo:"/logos/logo.png",siteFBAppID:"optional facebook app id for open graph in SEO.jsx",siteTwitterId:"@graysonhicks"}},postBySlug:{html:'<ul>\n<li><a href="#intro">Intro</a></li>\n<li><a href="#parts">Parts</a></li>\n<li><a href="#entry">Entry Point to Gatsby</a></li>\n<li><a href="#transforming">Transforming Markdown</a></li>\n<li><a href="#querying">Querying</a></li>\n<li><a href="#example">Example</a></li>\n</ul>\n<a name="intro"/>\n<h3 id="intro"><a href="#intro" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Intro</h3>\n<p>The <a href="https://github.com/graysonhicks/gatsby-starter-skinny-docs/blob/master/src/docs/table_of_contents.json"><code>table_of_contents.json</code></a> file is where you provide the structure for your documentation, and content for its navigation. It relies on Gatsby\'s <a href="https://www.gatsbyjs.org/packages/gatsby-transformer-remark/">gatsby-transformer-remark</a> to parse Markdown files. It is queried in the <a href="https://github.com/graysonhicks/gatsby-starter-skinny-docs/blob/master/src/templates/doc.jsx"><code>templates/doc.jsx</code></a> page and passed the data into the <a href="/table-of-contents-component"><code>&#x3C;TableOfContents / ></code></a> component.</p>\n<a name="parts"/>\n<h3 id="parts"><a href="#parts" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Parts</h3>\n<p>Main parts of the <code>json</code> file and their purpose:</p>\n<p><code>chapters</code> - Top-level structure. If a <code>chapter</code> is listed, then a corresponding <code>subchapter</code> is required. Not a link by default.</p>\n<p><code>subchapters</code> - Mid-level structure. If a <code>subchapter</code> is listed, then a corresponding <code>section</code> is required. Not a link by default.</p>\n<p><code>sections</code> - Bottom-level structure. Requires a <code>post</code> property that points to the corresponding Markdown file. The path to the Markdown file is relative to the <code>table_of_contents.json</code>. This is a link by default to the <code>slug</code> it\'s corresponding Markdown post.</p>\n<a name="entry"/>\n<h3 id="entry-point-to-gatsby"><a href="#entry-point-to-gatsby" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Entry Point to Gatsby</h3>\n<p>The <code>table_of_contents.json</code> is accessible to Gatsby through the <a href="https://www.gatsbyjs.org/packages/gatsby-source-filesystem/#gatsby-source-filesystem">gatsby-source-filesystem</a> plugin that is configured in this project\'s <code>gatsby-config.js</code> by this snippet:</p>\n<div class="gatsby-highlight">\n      <pre class="language-javascript"><code><span class="token punctuation">{</span>\n    resolve<span class="token punctuation">:</span> <span class="token string">\'gatsby-source-filesystem\'</span><span class="token punctuation">,</span>\n    options<span class="token punctuation">:</span> <span class="token punctuation">{</span>\n    name<span class="token punctuation">:</span> <span class="token string">\'docs\'</span><span class="token punctuation">,</span>\n    path<span class="token punctuation">:</span> <span class="token template-string"><span class="token string">`</span><span class="token interpolation"><span class="token interpolation-punctuation punctuation">${</span>__dirname<span class="token interpolation-punctuation punctuation">}</span></span><span class="token string">/src/docs/`</span></span><span class="token punctuation">,</span>\n    <span class="token punctuation">}</span><span class="token punctuation">,</span>\n<span class="token punctuation">}</span><span class="token punctuation">,</span>\n</code></pre>\n      </div>\n<p>If you want to move it, you must change the <code>path</code> above as well.</p>\n<a name="transforming"/>\n<h3 id="transforming"><a href="#transforming" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Transforming</h3>\n<p>After this initial entry point by <code>gatsby-source-filesystem</code>, a transformer that is installed, called <code>gatsby-transformer-remark</code> parses any Markdown files the filesystem finds and transforms them into special objects with unique fields and properties not available just as a .md file. This is important in the <code>gatsby-node.js</code> file, as we add a slug field.</p>\n<a name="querying"/>\n<h3 id="querying"><a href="#querying" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Querying</h3>\n<p>Because of the above snippet, the <code>table_of_contents.json</code> is now queriable by Gatsby wherever you may need it.</p>\n<p>By default, this query happens in the <code>templates/doc.jsx</code> file and looks like this:</p>\n<div class="gatsby-highlight">\n      <pre class="language-javascript"><code>tableOfContents<span class="token punctuation">:</span> docsJson <span class="token punctuation">{</span>\n      possibleProp\n      chapters <span class="token punctuation">{</span>\n        title\n        subchapters <span class="token punctuation">{</span>\n          title\n          sections <span class="token punctuation">{</span>\n            post <span class="token punctuation">{</span>\n              childMarkdownRemark <span class="token punctuation">{</span>\n                fields <span class="token punctuation">{</span>\n                  slug\n                <span class="token punctuation">}</span>\n                frontmatter <span class="token punctuation">{</span>\n                  title\n                <span class="token punctuation">}</span>\n              <span class="token punctuation">}</span>\n            <span class="token punctuation">}</span>\n          <span class="token punctuation">}</span>\n        <span class="token punctuation">}</span>\n      <span class="token punctuation">}</span>\n    <span class="token punctuation">}</span>\n</code></pre>\n      </div>\n<p>Note that you may add other fields to your Table of Contents items. The <code>childMarkdownRemark</code> is created in the <code>gatsby-node.js</code> file.</p>\n<a name="example"/>\n<h3 id="example"><a href="#example" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Example</h3>\n<p>Here is an example of how a multi-chapter Table of Contents could be set up:</p>\n<div class="gatsby-highlight">\n      <pre class="language-javascript"><code><span class="token punctuation">{</span>\n  <span class="token string">"id"</span><span class="token punctuation">:</span> <span class="token string">"table-of-contents"</span><span class="token punctuation">,</span>\n  <span class="token string">"possibleProp"</span><span class="token punctuation">:</span> <span class="token string">"possibleVal"</span><span class="token punctuation">,</span>\n  <span class="token string">"chapters"</span><span class="token punctuation">:</span> <span class="token punctuation">[</span>\n    <span class="token punctuation">{</span>\n      <span class="token string">"title"</span><span class="token punctuation">:</span> <span class="token string">"Chapter 1"</span><span class="token punctuation">,</span>\n      <span class="token string">"subchapters"</span><span class="token punctuation">:</span> <span class="token punctuation">[</span>\n        <span class="token punctuation">{</span>\n          <span class="token string">"title"</span><span class="token punctuation">:</span> <span class="token string">"Subchapter 1"</span><span class="token punctuation">,</span>\n          <span class="token string">"sections"</span><span class="token punctuation">:</span> <span class="token punctuation">[</span>\n            <span class="token punctuation">{</span>\n              <span class="token string">"post"</span><span class="token punctuation">:</span> <span class="token string">"./sub-1-section-1.md"</span>\n            <span class="token punctuation">}</span><span class="token punctuation">,</span>\n            <span class="token punctuation">{</span>\n              <span class="token string">"post"</span><span class="token punctuation">:</span> <span class="token string">"./sub-1-section-2.md"</span>\n            <span class="token punctuation">}</span>\n          <span class="token punctuation">]</span>\n        <span class="token punctuation">}</span><span class="token punctuation">,</span>\n        <span class="token punctuation">{</span>\n          <span class="token string">"title"</span><span class="token punctuation">:</span> <span class="token string">"Subchapter 2"</span><span class="token punctuation">,</span>\n          <span class="token string">"sections"</span><span class="token punctuation">:</span> <span class="token punctuation">[</span>\n            <span class="token punctuation">{</span>\n              <span class="token string">"post"</span><span class="token punctuation">:</span> <span class="token string">"./sub-2-section-1.md"</span>\n            <span class="token punctuation">}</span><span class="token punctuation">,</span>\n            <span class="token punctuation">{</span>\n              <span class="token string">"post"</span><span class="token punctuation">:</span> <span class="token string">"./sub-2-section-2.md"</span>\n            <span class="token punctuation">}</span>\n          <span class="token punctuation">]</span>\n        <span class="token punctuation">}</span>\n      <span class="token punctuation">]</span>\n    <span class="token punctuation">}</span><span class="token punctuation">,</span>\n    <span class="token punctuation">{</span>\n      <span class="token string">"title"</span><span class="token punctuation">:</span> <span class="token string">"Chapter 2"</span><span class="token punctuation">,</span>\n      <span class="token string">"subchapters"</span><span class="token punctuation">:</span> <span class="token punctuation">[</span>\n        <span class="token punctuation">{</span>\n          <span class="token string">"title"</span><span class="token punctuation">:</span> <span class="token string">"Subchapter 1"</span><span class="token punctuation">,</span>\n          <span class="token string">"sections"</span><span class="token punctuation">:</span> <span class="token punctuation">[</span>\n            <span class="token punctuation">{</span>\n              <span class="token string">"post"</span><span class="token punctuation">:</span> <span class="token string">"./ch-2-sub-1-section-1.md"</span>\n            <span class="token punctuation">}</span><span class="token punctuation">,</span>\n            <span class="token punctuation">{</span>\n              <span class="token string">"post"</span><span class="token punctuation">:</span> <span class="token string">"./ch-2-sub-1-section-2.md"</span>\n            <span class="token punctuation">}</span>\n          <span class="token punctuation">]</span>\n        <span class="token punctuation">}</span>\n      <span class="token punctuation">]</span>\n    <span class="token punctuation">}</span>\n  <span class="token punctuation">]</span>\n<span class="token punctuation">}</span>\n</code></pre>\n      </div>',timeToRead:3,excerpt:"Intro Parts Entry Point to Gatsby Transforming Markdown Querying Example Intro The  table_of_contents.json  file is where you provide theâ€¦",frontmatter:{title:"table_of_contents.json"}},tableOfContents:{possibleProp:"possibleVal",chapters:[{title:"Docs",subchapters:[{title:"Install",sections:[{post:{childMarkdownRemark:{fields:{slug:"/install"},frontmatter:{title:"Install"}}}},{post:{childMarkdownRemark:{fields:{slug:"/get-started"},frontmatter:{title:"Get Started"}}}}]},{title:"Development",sections:[{post:{childMarkdownRemark:{fields:{slug:"/development"},frontmatter:{title:"Development"}}}},{post:{childMarkdownRemark:{fields:{slug:"/building"},frontmatter:{title:"Building"}}}},{post:{childMarkdownRemark:{fields:{slug:"/deploying"},frontmatter:{title:"Deploying"}}}}]},{title:"How It Works",sections:[{post:{childMarkdownRemark:{fields:{slug:"/basic-data-flow"},frontmatter:{title:"Basic Data Flow"}}}},{post:{childMarkdownRemark:{fields:{slug:"/table-of-contents-json"},frontmatter:{title:"table_of_contents.json"}}}},{post:{childMarkdownRemark:{fields:{slug:"/gatsby-node-js"},frontmatter:{title:"gatsby-node.js"}}}},{post:{childMarkdownRemark:{fields:{slug:"/table-of-contents-component"},frontmatter:{title:"TableOfContents Component"}}}},{post:{childMarkdownRemark:{fields:{slug:"/home-page"},frontmatter:{title:"Home Page"}}}},{post:{childMarkdownRemark:{fields:{slug:"/demo-page"},frontmatter:{title:"Demo Page"}}}}]},{title:"Gatsby Specific",sections:[{post:{childMarkdownRemark:{fields:{slug:"/plugins"},frontmatter:{title:"Plugins"}}}},{post:{childMarkdownRemark:{fields:{slug:"/source"},frontmatter:{title:"Source"}}}},{post:{childMarkdownRemark:{fields:{slug:"/transformers"},frontmatter:{title:"Transformers"}}}}]},{title:"Credits and Contributing",sections:[{post:{childMarkdownRemark:{fields:{slug:"/credits"},frontmatter:{title:"Credits"}}}},{post:{childMarkdownRemark:{fields:{slug:"/contributing"},frontmatter:{title:"Contributing"}}}}]}]}]}},pathContext:{slug:"/table-of-contents-json"}}}});
